import React from 'react'
import Home from './Home';
import {
  Route,
  Routes,
} from "react-router-dom";

function Pages() {
  return (
    <div>
        
          <Routes>
            
            <Route path="/" element={<Home/>} />
            <Route path='/about' element={<Delicious/>}/>
            
          </Routes>
        
    </div>
  )
}

export default Pages
